INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (2, N'Deadpool & Wolverine', , N'Deadpool is offered a place in the Marvel Cinematic Universe by the Time Variance Authority, but instead recruits a variant of Wolverine to save his universe from extinction.', 15, CAST(N'2024-07-22' AS Date), CAST(N'02:08:00' AS Time), CAST(4.3 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (6, N'Batman Beyond: Return of the Joker', , N'Den glatte, tilsyneladende udødelige Joker er tilbage, og han afstedkommer som sædvanligt total ødelæggelse. Batman forsøger at få fat i Jokerens hemmelighed: Hvad skete der egentlig den nat, da Bruce sloges mod Jokeren for sidste gang? Da Bruce Wayne var ved at blive dræbt af et af Jokerens angreb, aflægger den nye Batman et løfte til sin mentor: At fjerne Jokeren i al fremtid.', 7, CAST(N'2000-10-31' AS Date), CAST(N'01:16:00' AS Time), CAST(4.7 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (8, N'Raiders of the Lost Ark', , N'In 1936, archaeologists and adventurers of the U.S. government hired Indiana Jones to find the Ark of the Covenant before the Nazis could obtain its extraordinary powers.', 15, CAST(N'1982-01-15' AS Date), CAST(N'01:55:00' AS Time), CAST(4.2 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (9, N'The Dark Knight Rises', , N'Bane, an imposing terrorist, attacks Gotham City and disrupts its eight-year-long period of peace. This forces Bruce Wayne to come out of hiding and don the cape and cowl of Batman again.', 11, CAST(N'2012-07-20' AS Date), CAST(N'02:44:00' AS Time), CAST(4.4 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (10, N'Back to the Future', , N'Marty McFly, a 17-year-old high school student, is accidentally sent 30 years into the past in a time-traveling DeLorean invented by his close friend, the maverick scientist Doc Brown.', 11, CAST(N'1985-07-03' AS Date), CAST(N'01:56:00' AS Time), CAST(4.8 AS Decimal(2, 1)))
GO
