INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (13, N'The Shawshank Redemption', , N'A banker convicted of uxoricide forms a friendship over a quarter century with a hardened convict, while maintaining his innocence and trying to remain hopeful through simple compassion.', 15, CAST(N'1994-10-14' AS Date), CAST(N'02:22:00' AS Time), CAST(4.8 AS Decimal(2, 1)))
