INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (14, N'9', , N'I en postapokalytisk udbombet verden vågner kludedukken 9 og begiver sig ud i landskabet. Inden længe finder han andre overlevende kludedukker og sammen prøver de at overleve og at afdække mysteriet om deres egen eksistens og om tingenes tilstand. De er dog ikke helt enige om, hvad der er den rette overlevelsesstrategi i det fjendtlige univers, og det bliver ikke bedre, da 9 uforvarende kommer til at forvandle situationen fra ond til værre.', 11, CAST(N'2009-09-09' AS Date), CAST(N'01:50:00' AS Time), CAST(4.4 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (15, N'Super Mario Bros.', , N'To blikkenslagere fra Brooklyn, Mario og Luigi, må rejse til en anden dimension for at redde en prinsesse fra den onde diktator King Koopa og forhindre ham i at overtage verden.', 15, CAST(N'1993-07-24' AS Date), CAST(N'01:44:00' AS Time), CAST(3.4 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (17, N'Jurassic Park', , N'An industrialist invites some experts to visit his theme park of cloned dinosaurs. After a power failure, the creatures run loose, putting everyones lives, including his grandchildrens, in danger.', 11, CAST(N'1993-06-11' AS Date), CAST(N'02:07:00' AS Time), CAST(4.7 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (18, N'The Nightmare Before Christmas', , N'Kom ind i en usædvanlig verden med magi og under, hvor hver helligdag har sin egen jord. Dette er den hjertevarme fortælling om Jack Skellington, Den Store Græskarmand fra Halloween Town. Han keder sig i sin gamle skræm-og-skrig-rutine og længes efter at sprede juleglæde. Men hans muntre mission sætter julemanden i fare, og kludedukken Sally, der elsker ham, må træde til.', 0, CAST(N'2003-11-12' AS Date), CAST(N'01:16:00' AS Time), CAST(4.6 AS Decimal(2, 1)))
GO
INSERT [dbo].[Film] ([ID], [Titel], [Plakat], [Synopse], [Aldersgrænse], [Udgivelsesdato], [Spilletid], [Gennemsnitsanmeldelse]) VALUES (19, N'Dangal', , N'Mahavir Singh Phogat, a former wrestler, decides to fulfill his dream of winning a gold medal for his country by training his daughters for the Commonwealth Games despite the existing social stigmas.', 12, CAST(N'2016-12-21' AS Date), CAST(N'02:41:00' AS Time), CAST(4.4 AS Decimal(2, 1)))
GO
